import React from 'react';
import { Link } from 'react-scroll';

const NavItem = ({ link, setIsScroll }) => {
  return (
    <Link
      className='mobile-menu-item'
      to={link.name}
      smooth={true}
      duration={500}
    >
      {link.display}
    </Link>
  );
};

export default NavItem;
